Recoverable errors may be expressed through values of the error type. This is a special type in the language, and it is the only which cannot be expressed through a literal. Values of the error type can only be created using the std.error function, which expects a string description and a arbitrary context: function check_limit(x) if x > 10 then std.error("x cannot be bigger than 10", x) else x end
end One can then check whether the function has returned an error: let result = check_limit(11) if std.type(result) == "error" then std.print("Error: ", result)
else std.print("Success: ", result)
end The description and context fields can be accessed as in a dictionary, but unlike in dictionaries, those cannot be assigned to: let error = std.error("oh no!", 42) std.print(error.description) # oh no! error.description = "you shouldn't do that!" # panic Examples of errors should be recoverable: File not found. Insufficient permission Invalid format Command not found Command returned non-zero exit status

