The try (? [2] ) operator may be used to early return from a function if an error occurs. It is nothing but syntax sugar for an if expression, and therefore it may be used in any expression: function safe_div_mod(x, y) if y == 0 then std.error("division by zero", nil) else @[ div: x / y, mod: x % y ] end
end # The following are equivalent: function foo() let result = safe_div_mod(5, 0) let value = if std.type(result) == "error" then return result else result end std.print(value)
end function bar() let value = safe_div_mod(5, 0)? std.print(value) # this won't be executed, as `?` will trigger an early return.
end # The `?` operator may be used in any expression:
function run() std.print("div: ", safe_div_mod(5, 0)?.div)
end [1] One can actually catch a panic using the std.catch function, but that should be used sparingly. [2] If you're familiar with both languages, Hush 's try operator might feel like the unholy child of Rust's ? operator and Go's if err != nil { return err }.

