In Hush , command blocks are delimited with curly braces: { echo Hello world! } They are valid expressions, and will result in error or nil . Therefore, we can use this result to check whether the block was successfully executed: let result = { touch /etc/config # we may not have permission for that directory!
} if std.type(result) == "error" then std.print("Error: ", result)
end They may even be combined with the try operator: function run() { mkdir /etc/config/ }? std.print("Success!") # This won't be executed if the command block fails.
end let result = run()
if std.type(result) == "error" then std.print("Error: ", result)
end As they are blocks, they may have multiple commands, which must be delimited by semicolons. This enables us to include line comments in between their arguments: { find . # search in the current directory. -type f # only files. -iname '*.png'; # case insensitive match on name. ls ../some-other-dir/images; # list files from another directory. cat additional-files.txt # The semicolon in the last command is optional.
}

