Pipelines and redirections use standard syntax: { echo Hello world! | sed s/world/universe/g | tr '!' '.'; echo overwrite file using stdout > file.txt; echo overwrite file using stderr 2> file.txt; echo append to file using stdout >> file.txt; echo stderr too 2>> file.txt; cat < file.txt; # redirect file to stdin cat << "here's an inline string"; # string to stdin rm file.txt 2>1; # redirect stderr to stdout. Opposed to Bash, we don't need an `&` # We may compose as many of those as we need: cat file.txt # Read a file. << "Hello world!" # Concat it with data from stdin. 2>> errors.txt # Save errors to file. | tee output.txt # Dump data to another file. 2>> errors.txt # Save errors to file. | curl localhost:8080 -d @- # HTTP POST data to server. 2>> errors.txt; # Save errors to file.
} But there's an additional requirement for redirections: they may not precede arguments: { echo Hello 2>1 } # Ok.
{ echo 2>1 Hello } # Syntax error.

