In order to provide ergonomic manipulation of the file system, most shells provide a mechanism named expansions . It allows the programmer to refer to multiple file names using a regex-like syntax. Hush provides automatic expansion only for literal arguments . That means you won't have to worry if your variables contains characters that may be expanded. let var = "*"
{ echo *; # Will print all files/directories in the current directory. # The following will print just an asterisk. echo "*"; echo $var;
} Hush currently provides the following expansions: %: matches zero or one character, except for the path separator. *: matches zero or more characters, except for the path separator. **: matches zero or more directories. ~/: matches the $HOME directory, only when in the prefix of an argument. Opposed to traditional shells, Hush will always expand relative paths prefixed with ./: { touch test.txt; # Create a file echo *; # Will print "./test.txt"
} You won't have to worry about flag injection from file names ever again.

